INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('4260358512891', 'Prezzo Speciale! Purizon Gatto - Adult Pollo & Pesce', 'CH BE Aliment complet pour chats adultes - Poulet & poisson Purizon sinspire de l\'alimentation du chat qui est, de par nature, un carnivore. De qualité premium, Purizon a été développé avec 70 % de viande et de poisson, dont une large part de viande de poulet sélectionnée fraîche issue d\'élevages respectueux de l\'espèce, du hareng fraîchement pêché en Mer du Nord ainsi que des ingrédients très nutritifstels que de l\'huile de hareng de qualité supérieure, le tout sans céréales. À la place des céréales ou du riz, Purizon contient des fruits de haut niveau qualitatif, des légumes et plusieurs herbes apportant les vitamines et minéraux nécessaires et favorisant la santé et la vitalité de votre chat. Grâce à la préparation en douceur, les nutriments sont préservés, tout comme le goût original. Purizon : des ingrédients naturels de qualité supérieure pour une nourriture animale durable. 70 % de viande et de poisson - 30 % de fruits, de légumes, d\'herbes, de plantes, de vitamines et de minéraux - O % de céréales. Composition : 30 de viande de poulet fraiche désossée, 28 % de viande de poulet déshydratée, 18 % de pommes de terre, 5 % de graisse de poulet. 2 % d\'œuf sec, % de hareng sans arêtes frais % de hareng déshydraté, huile de poisson (100 % d\'huile de hareng), protéines animales hydroiysées, fibres de petits pois, carottes déshydratées de luzerne déshydratée. inuhne. fructo-oligosaccharides, mannan-oligosaccharides, 0,5 % de grenade déshydratée, pomme déshydratée, épinard déshydraté, % de psyllium, cassis déshydraté orange douce déshydratée. myrtilles déshydratées chlorure de sodium. levure de bière déshydratée, 0,2 % de racines de curcuma, 0,12 % de glucosamine 0,09 de suffate de chondromne, extrait de souci. Sans colorants ni conservateurs ni arômes artificiels Sans lactose. Teneur en cdories/kg :', '', '20', '4.2', '0', '0', '', '44', '0', '0', '', '1');

